exports.handler = async (event, context) => {
  const id = event.queryStringParameters.id;
  console.log(id)
  if (!id) {
    return {
      statusCode: 400,
      body: "Your request must include an ID parameter.",
    }
  }
  const data = data ();
  let hits = data.filter(recipient => {
    return Number.parseInt( recipient.id ) === Number.parseInt( id )
  }) 

  if (hits.length > 0) {
    return {
      statusCode: 200,
      body: JSON.stringify(hits) ,
    };
  } else {
    return {
      statusCode: 404,
      body: "{message: 'No stipend was found for that Employee ID.'}",
    }
  }
};
